import React, { Component } from 'react';
import {withRouter} from 'react-router-dom';
import {Container, Row, Col, Navbar,Image} from 'react-bootstrap';
import {Animated} from "react-animated-css";
import {AnimatedOnScroll} from "react-animated-css-onscroll";
import './Works.css'

class Works extends Component {

    constructor(props){
        super(props);
        props.callbackPage(props.location.pathname);
    }
  render() {
    return (
        <div>
          <div className='works'>
            </div>
                <div className='works-central'>
                </div>
                <Container className='container'>
                    <h1 className='works-h1' align='center'>CLOTHES</h1>
                    <h1 align='center'>PAINTING</h1>
                    <h1 align='center'>MUSIC</h1>
                    <h1 align='center'>TATTOO</h1>
                    <h1 align='center'>DANCE</h1>
            </Container>
            <footer className='other-footer' align="center">@BKF2020 by Stadler Raphael</footer>
        </div>
    );
  }
}

export default Works;
